import "./AboutContentStyle.css";

import React from 'react'

const AboutContent = () => {
  return (
    <div className="about">
        <div className="left">
            <h1>Who Am I ?</h1>
            <p>Im a react front-end developer. I create responsive secure websites of ny clients.</p>
            <link to="/contact"></link>
        </div>
        <div className="right"></div>     
    </div>
  )
}

export default AboutContent
